import React from "react";

function Receipe() {
    return(
        <div className="receipe">
            <div class="container">
                <div class="row align-items-center my-5">
                    <div class="col-lg-7">

                    </div>
                    <div class="col-lg-5">
                        <h1 class="font-weight-light">Receipe</h1>
                        <p>This page will be added many receipes with cdns.</p>
                    </div>
                </div>
            </div>
        </div>
    );
}
